import { initState } from '../initState';

export const addStatus = (state = initState, action) =>{
const { type, payload } = action;
switch (type) {
  case 'NEW':
    return { 
      id: payload.id,
      name: payload.name,
      addres: payload.addres,
      status: payload.status,
      comment: payload.comment,
      createdAt: payload.createdAt,
    };
    case 'DONE':
      return { 
         name: payload.name,
         addres: payload.addres,
         status: payload.status,
         comment: payload.comment,
         createdAt: payload.createdAt,
      };
    default:
      return state;
  }
}
